selector_to_html = {"a[href=\"#level-1-annotation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 1 Annotation<a class=\"headerlink\" href=\"#level-1-annotation\" title=\"Permalink to this heading\">#</a></h1><h2>Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 1 annotation, we devided the mesenchyme into two main groups. We are surprised to find that these two clusters are closely associated with ages.\n<img alt=\"png\" src=\"../_images/anno_c1_age.png\"/></p><p>Therefore, we named these two clusters as <code class=\"docutils literal notranslate\"><span class=\"pre\">Embryonic</span> <span class=\"pre\">Mesenchyme</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Postnatal</span> <span class=\"pre\">Mesenchyme</span></code>.</p>", "a[href=\"#postnatal-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Postnatal Mesenchyme<a class=\"headerlink\" href=\"#postnatal-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>The postnatal mesenchyme includes dentin-producing odontoblasts, the pulp, and the dental follicle <span id=\"id2\">[<a class=\"reference internal\" href=\"../references.html#id26\" title=\"R. Fresia, P. Marangoni, T. Burstyn-Cohen, and A. Sharir. From Bite to Byte: Dental Structures Resolved at a Single-Cell Resolution. Journal of Dental Research, 100(9):897\u2013905, August 2021. doi:10.1177/00220345211001848.\">Fresia <em>et al.</em>, 2021</a>]</span></p><p>The marker genes between these two groups are different. The typical markers of embryonic mesenchyme genes are highly expressed in Embryonic Mesenchyme, such as Prrx1 <span id=\"id3\">[<a class=\"reference internal\" href=\"../references.html#id19\" title=\"Litian Han, Yaoting Ji, Yiqian Yu, Yueqi Ni, Hao Zeng, Xiaoxin Zhang, Huan Liu, and Yufeng Zhang. Trajectory-centric framework TrajAtlas reveals multi-scale differentiation heterogeneity among cells, genes, and gene modules in osteogenesis. PLOS Genetics, 20(10):e1011319, October 2024. doi:10.1371/journal.pgen.1011319.\">Han <em>et al.</em>, 2024</a>]</span>. And marker genes of dental msenchyme stem cells are highly expressed in Postnatal Mesenchyme, such as Msx2 <span id=\"id4\">[<a class=\"reference internal\" href=\"../references.html#id30\" title=\"Yingchun Zheng, Ting Lu, Leitao Zhang, Zhongzhi Gan, Aoxi Li, Chuandong He, Fei He, Sha He, Jian Zhang, and Fu Xiong. Single-cell RNA-seq analysis of rat molars reveals cell identity and driver genes associated with dental mesenchymal cell differentiation. BMC Biology, 22(1):1\u201313, September 2024. doi:10.1186/s12915-024-01996-w.\">Zheng <em>et al.</em>, 2024</a>]</span> .</p>", "a[href=\"#embryonic-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Embryonic Mesenchyme<a class=\"headerlink\" href=\"#embryonic-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>The embryonic mesenchyme originates from cranial neural crest cells (CNCCs). After migrating into the oral region of the first pharyngeal arch, these postmigratory CNCCs commit to the dental mesenchymal lineage <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.</p>", "a[href=\"#motivation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 1 annotation, we devided the mesenchyme into two main groups. We are surprised to find that these two clusters are closely associated with ages.\n<img alt=\"png\" src=\"../_images/anno_c1_age.png\"/></p><p>Therefore, we named these two clusters as <code class=\"docutils literal notranslate\"><span class=\"pre\">Embryonic</span> <span class=\"pre\">Mesenchyme</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Postnatal</span> <span class=\"pre\">Mesenchyme</span></code>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`div.content ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
